            var latCol, lonCol

            let filterText;
            localStorage.getItem('moscowFilterText') === null ? filterText = '' : 
                filterText = localStorage.getItem('moscowFilterText')

            for (let h = 0; h < v.data[0].length; h++) {

                if (v.data[0][h] == 'lat') {
