                    }

                    for (let j = 0; j < moscowHeaders.length; j++) {
                        point[moscowHeaders[j]] = v.data[i][j]
                    }

                    var marker = new Feature(point)
                    markerList.push(marker)
                }
            }

            moscowLayer.setSource(new VectorSource({
                features: markerList,
            }))
        })
    }
    catch (error) {
        console.error(error);
    }
}

